INSERT INTO `pages` VALUES (1,'/','Лайф Медикал','Лайф Медикал','Лайф Медикал','Лайф Медикал','<div class=\"textBlock\">\r\n<h2 class=\"blockHeader base\">Портал медико-генетических центров</h2>\r\n<div class=\"blockContent base\">\r\n<p>Медико-генетический портал – это уникальный интернет-проект, собравший на своих страницах всю существующую информацию из мира медицинской генетики. Медико-генетические центры предоставляют комфортные условия для сдачи необходимых генетических анализов, результаты которых отличаются высокой точностью. Специалисты медицинских центров портала в Санкт-Петербурге выполняют главные условия планирования семьи: высокая скорость выполнения исследований, точность результатов и индивидуальный подход к каждой супружеской паре.</p>\r\n</div>\r\n</div>\r\n<div class=\"clearfix textBlock_ramka\">\r\n<h2 class=\"blockHeader base\">Консультации врачей</h2>\r\n<p class=\"base\">Кроме того, в наших центрах проводят консультации врач-эндокринолог, аллерголог (к.м.н.), врач УЗ-диагностики, оказывающие весь спектр лечебных и диагностических услуг в соответствующих областях. Специалисты по ультразвуковой диагностике проводят высококачественное обследование на новейшем оборудовании. Гинекологические клиники на высоком уровне предоставляют такую услугу, как консультация маммолога, что особенно актуально в связи с ростом доброкачественных и злокачественных заболеваний молочной железы.</p>\r\n</div>\r\n<div class=\"base\" id=\"map\" style=\"height:450px;    margin: 20px 0 40px 0;\"> </div>\r\n<script type=\"text/javascript\">\r\n  ymaps.ready(init);\r\n    var myMap;\r\n\r\n    function init(){     \r\n        myMap = new ymaps.Map (\"map\", {\r\n            center: [59.965650, 30.305995],\r\n            zoom: 11,\r\n			controls: []\r\n        },\r\n		{suppressMapOpenBlock: true}),\r\n		balloonLayout = ymaps.templateLayoutFactory.createClass(\'<div class=\"my-balloon\">$[properties.balloonContent]</div>\');\r\n\r\n\r\n		var marker1=new ymaps.Placemark([60.007182, 30.295126], {\r\n            balloonContent: \'<div class=\"my-balloon_zhizn\"><table class=\"simple\"><tbody><tr><th colspan=\"2\">МГЦ «ЖИЗНЬ»</th></tr><tr><td colspan=\"2\">тел. +7 921 947 65 38</td></tr><tr><td colspan=\"2\">Коломяжский пр., 28</td></tr><tr class=\"mHide\"><td colspan=\"2\">м. Пионерская</td></tr><tr class=\"mHide\"><td colspan=\"2\">Часы работы:</td></tr><tr class=\"mHide\"><td>пн.</td><td>9-19</td></tr><tr class=\"mHide\"><td>вт.</td><td>9-19</td></tr><tr class=\"mHide\"><td>ср.</td><td>9-19</td></tr><tr class=\"mHide\"><td>чт.</td><td>9-19</td></tr><tr class=\"mHide\"><td>пт.</td><td>9-19</td></tr><tr class=\"mHide\"><td>сб.</td><td>10-16</td></tr><tr class=\"mHide\"><td>вс.</td><td>выходной</td></tr></tbody></table></div>\',\r\n            iconContent: \'<span class=\"iconContent\"><span>МГЦ «ЖИЗНЬ»</span></span>\',\r\n//			balloonContentHeader:\"999999999999999999999999999999999999999999999999999999\"\r\n        }, {\r\n            // Зададим произвольный макет метки.\r\n			balloonLayout:balloonLayout,\r\n			// Не скрываем иконку при открытом балуне.\r\n            hideIconOnBalloonOpen: false,\r\n            // И дополнительно смещаем балун, для открытия над иконкой.\r\n            balloonOffset: [-218, -150],\r\n            iconLayout: \'default#imageWithContent\',\r\n            iconImageHref: \'/img/icon1.png\',\r\n			iconImageSize: [160, 43],\r\n			iconImageOffset: [-18, -43],\r\n//			balloonContentHeader:\"999999999999999999999999999999999999999999999999999999\"\r\n        });\r\n        myMap.geoObjects.add(marker1);\r\n		\r\n		marker1.events.add(\'mouseenter\', function (e) {\r\n\r\n			e.get(\'target\').options.set(\'iconImageHref\', \'/img/iconHover1.png\'); \r\n\r\n		});\r\n		\r\n		marker1.events.add(\'mouseleave\', function (e) {\r\n\r\n			e.get(\'target\').options.set(\'iconImageHref\', \'/img/icon1.png\'); \r\n\r\n		});\r\n		var marker2=new ymaps.Placemark([59.928807, 30.249312], {\r\n            balloonContent: \'<div class=\"my-balloon_serbalab\"><table class=\"simple\"><tbody><tr><th colspan=\"2\">МГЦ «СЕРБАЛАБ»</th></tr><tr><td colspan=\"2\">тел. +7 812 602 93 38</td></tr><tr><td colspan=\"2\">Большой пр. В. О., 90, к. 2</td></tr><tr class=\"mHide\"><td colspan=\"2\">м. Василеостровская, Приморская</td></tr><tr class=\"mHide\"><td colspan=\"2\">Часы работы:</td></tr><tr class=\"mHide\"><td>пн.</td><td>9-19</td></tr><tr class=\"mHide\"><td>вт.</td><td>9-19</td></tr><tr class=\"mHide\"><td>ср.</td><td>9-19</td></tr><tr class=\"mHide\"><td>чт.</td><td>9-19</td></tr><tr class=\"mHide\"><td>пт.</td><td>9-19</td></tr><tr class=\"mHide\"><td>сб.</td><td>10-16</td></tr><tr class=\"mHide\"><td>вс.</td><td>выходной</td></tr></tbody></table></div>\',\r\n            iconContent: \'<span class=\"iconContent\"><span>МГЦ «СЕРБАЛАБ»</span></span>\'\r\n        }, {\r\n            // Зададим произвольный макет метки.\r\n			balloonLayout:balloonLayout,\r\n			// Не скрываем иконку при открытом балуне.\r\n            hideIconOnBalloonOpen: false,\r\n            // И дополнительно смещаем балун, для открытия над иконкой.\r\n            balloonOffset: [-218, -150],\r\n            iconLayout: \'default#imageWithContent\',\r\n            iconImageHref: \'/img/icon2.png\',\r\n			iconImageSize: [180, 43],\r\n			iconImageOffset: [-18, -43],\r\n        });\r\n		myMap.geoObjects.add(marker2);\r\n		\r\n		\r\n		marker2.events.add(\'mouseenter\', function (e) {\r\n\r\n			e.get(\'target\').options.set(\'iconImageHref\', \'/img/iconHover2.png\'); \r\n\r\n		});\r\n		\r\n		marker2.events.add(\'mouseleave\', function (e) {\r\n\r\n			e.get(\'target\').options.set(\'iconImageHref\', \'/img/icon2.png\'); \r\n\r\n		});\r\n		\r\n		var marker3=new ymaps.Placemark([59.967331, 30.384041], {\r\n            balloonContent: \'<div class=\"my-balloon_biogarmonia\"><table class=\"simple\"><tbody><tr><th colspan=\"2\">МГЦ «БИОГАРМОНИЯ»</th></tr><tr><td colspan=\"2\">тел. +7 812 643 66 77</td></tr><tr><td colspan=\"2\">Кондратьевский пр., 23</td></tr><tr class=\"mHide\"><td colspan=\"2\">м. Выборгская, Площадь Ленина</td></tr><tr class=\"mHide\"><td colspan=\"2\">Часы работы:</td></tr><tr class=\"mHide\"><td>пн.</td><td>9-18</td></tr><tr class=\"mHide\"><td>вт.</td><td>9-18</td></tr><tr class=\"mHide\"><td>ср.</td><td>9-18</td></tr><tr class=\"mHide\"><td>чт.</td><td>9-18</td></tr><tr class=\"mHide\"><td>пт.</td><td>9-18</td></tr><tr class=\"mHide\"><td>сб.</td><td>11-14</td></tr><tr class=\"mHide\"><td>вс.</td><td>выходной</td></tr></tbody></table></div>\',\r\n            iconContent: \'<span class=\"iconContent\"><span>МГЦ «БИОГАРМОНИЯ»</span></span>\'\r\n        }, {\r\n            // Зададим произвольный макет метки.\r\n			balloonLayout:balloonLayout,\r\n			// Не скрываем иконку при открытом балуне.\r\n            hideIconOnBalloonOpen: false,\r\n            // И дополнительно смещаем балун, для открытия над иконкой.\r\n            balloonOffset: [18, -150],\r\n            iconLayout: \'default#imageWithContent\',\r\n            iconImageHref: \'/img/icon3.png\',\r\n			iconImageSize: [210, 43],\r\n			iconImageOffset: [-18, -43],\r\n        });\r\n		\r\n		myMap.geoObjects.add(marker3);\r\n		\r\n		marker3.events.add(\'mouseenter\', function (e) {\r\n\r\n			e.get(\'target\').options.set(\'iconImageHref\', \'/img/iconHover3.png\'); \r\n\r\n		});\r\n		\r\n		marker3.events.add(\'mouseleave\', function (e) {\r\n\r\n			e.get(\'target\').options.set(\'iconImageHref\', \'/img/icon3.png\'); \r\n\r\n		});\r\n    }\r\n</script>',1,'2019-04-13 12:02:41','2019-04-14 12:16:35','Главная',0,NULL,1),(2,'about','О нас','О нас','О нас','О нас','<article>\r\n        <h1>О нас</h1>\r\n        <p><b>Медико-генетический портал - </b>это новый специализированный интернет-проект, посвященный генетике, в том числе и спортивной.</p>\r\n<p><b>Медико-генетический портал - </b>это еще и собственная клинико-лабораторная служба, где Вы сможете пройти консультации ведущих врачей-специалистов, а также сдать огромный спектр лабораторных анализов и пройти ультразвуковую диагностику. Медицинские центры портала - это и клиника урологии и маммологический центр, а также клиники ведения беременности и др.  Все это обеспечивает точность и скорость установления диагноза и проведение новейших методов лечения заболеваний.<br />\r\n<br />\r\nСеть медико-генетических центров «Жизнь» включает в себя три медицинских центра в разных районах Санкт-Петербурга, специализирующихся на всех видах генетической диагностики. <br />\r\n<br />\r\nОсновными направлениями нашей деятельности являются:<br />\r\n• Медико-генетическое консультирование;<br />\r\n• Выявление генетической предрасположенности к онкологическим, сердечно-сосудистым, эндокринным, аутоимунным, акушерско-гинекологическим и многим другим заболеваниям;<br />\r\n• Планирование беременности, включающее диагностику носительства моногенных заболеваний и различных хромосомных и генных перестроек у будущих родителей, диагностику указанных патологий у членов семьи;<br />\r\n• Диагностика тяжелых наследственных патологий;<br />\r\n• Комплексная диагностика в случае неразвивающейся беременности и самопроизвольных выкидышей;<br />\r\n• Преимплантационная генетическая диагностика (ПГД) при ЭКО;<br />\r\n• Генетические паспорта, в том числе генетические паспорта для спортсменов. </p>\r\n<p>В основе планирования диагностики, лечения и профилактики многих заболеваний, а также планирования семьи и индивидуального образа жизни, уже более 10 лет лежит генетическая диагностика. Известно, что основой всех процессов в организме является структура генов и генома в целом. На протяжении последних десятилетий ученые и врачи всего мира занимаются усовершенствованием методик, позволяющих наиболее точно установить наличие и особенности изменений в геноме, и связать их с клинической картиной заболеваний. <br />\r\n<br />\r\nОсновная цель наших центров – обеспечение своевременного и доступного медико-генетического консультирования для пациентов и комплексного подхода в диагностике генетических патологий с использованием наиболее адекватных, в том числе самых современных методов, а также максимальное уменьшение сроков выполнения и стоимости анализов. <br />\r\n<br />\r\nУспех в реализации этих амбициозных планов обеспечивается тем, что основателями и руководителями сети медико-генетических центров «Жизнь» являются ведущие специалисты СПбГУ и РАН Олег Сергеевич Глотов, Андрей Сергеевич Глотов и Асеев Михаил Владимирович, посвятившие многие годы научной работе в различных областях общей и медицинской генетики. Являясь сотрудниками крупных научных и медицинских центров Санкт-Петербурга, таких как лаборатория генетики городской больницы №40, НИИ АГиР им. Д.О. Отта и Научный Парк СПБГУ, они лично принимают участие в руководстве современными генетическими научно-исследовательскими проектами. <br />\r\n<br />\r\nТакое объединение передовых научных направлений и прикладной медицинской диагностики позволяет нашим специалистам быть в курсе всех последних достижений в области медицинской генетики и предлагать пациентам и врачебному сообществу наиболее оптимальные пути диагностики заболеваний любыми необходимыми методами, от цитогенетических и иммуногистохимических до микроматричного анализа и секвенирования NGS. <br />\r\n<br />\r\nНами накоплен положительный опыт партнерских отношений с различными медицинскими учреждениями. Мы уже наладили систему генетического консультирования и поставки услуг генетической диагностики в целом ряде клиник, женских консультаций, больниц, оздоровительных и спортивных центров и готовы к новым партнерским отношениям. <br />\r\n<br />\r\nКомплексный подход к генетической диагностике – основа медицинской генетики XXI века. В медико-генетических центрах «Жизнь» он выражается в наличии медико-генетического консультирования до и после назначения необходимой диагностики, а также в возможности назначения любого генетического обследования, независимо от того, в какой лаборатории оно выполняется.  При наличии множества лабораторий различного профиля и огромного спектра типов исследований, существует острая необходимость координации работы этих лабораторий в отношении диагностики каждого пациента. В сети наших медицинских центров пациенты имеют уникальную возможность воспользоваться услугами любых Российских и даже зарубежных лабораторий. Разработанная нами логистическая схема, включающая собственную курьерскую службу, позволяет оперативно доставлять материал в наши центры из любой точки Санкт-Петербурга и из всех регионов России, и незамедлительно транспортировать его в лабораторию. При этом специалисты наших центров самостоятельно скоординируют сортировку, отправку материала, получение и составление единого заключения для пациента. <br />\r\n<br />\r\nМедико-генетическое консультирование – первый и наиболее важный этап в процессе выявления патологий и постановки диагноза. Именно консультация врача-генетика позволяет заподозрить генетическую природу болезни, прийти к назначению необходимой диагностики и, в конечном счете, планированию дальнейшего лечения пациента. В сети наших центров квалифицированные врачи-генетики регулярно решают подобные задачи в области генетики предрасположенностей, репродуктивного здоровья и планировании беременности, тяжелых наследственных патологий, преимплантационной генетической диагностики, а также в отношении генетических основ питания, образа жизни, спорта и фитнеса.<br />\r\n<br />\r\nНаиболее важными и востребованными диагностическими комплексами, доступными в наших центрах, являются:<br />\r\n<br />\r\nПри неразвивающейся беременности и самопроизвольных выкидышах:<br />\r\n• Цитогенетическое кариотипирование абортивного материала;<br />\r\n• Микроматричное кариотипирование абортивного материала;<br />\r\n• Иммуногистохимическое исследование абортивного материала;<br />\r\n• ПЦР-диагностика инфекций абортивного материала;<br />\r\n• Кариотипирование по лимфоцитам периферической крови обоих членов супружеской пары;<br />\r\n• Микроматричное кариотипирование членов супружеской пары;<br />\r\n• Анализ генов главного комплекса гистосовместимости;<br />\r\n• Анализ наиболее распространённых полиморфизмов как у мужчины, так и у женщины, связанных с нарушениями протекания беременности у женщины.<br />\r\n<br />\r\nПри планировании беременности:<br />\r\n• Оценка носительства моногенных заболеваний у супружеской пары;<br />\r\n• Цитогенетическое кариотипирование членов супружеской пары;<br />\r\n• Микроматричное кариотипирование членов супружеской пары;<br />\r\n• Анализ генов главного комплекса гистосовместимости;<br />\r\n• Анализ наиболее распространённых полиморфизмов как у мужчины, так и у женщины, связанных с нарушениями протекания беременности у женщины.<br />\r\n<br />\r\nПри ведении беременности:<br />\r\n• УЗИ и биохимический скрининг;<br />\r\n• Неинвазивная пренатальная диагностика хромосомных патологий плода по крови беременной;<br />\r\n• Определение Rh-фактора плода по крови беременной;<br />\r\n• Определение пола плода по крови беременной;<br />\r\n• Цитогенетическое кариотипирование биопсии клеток хориона в случае подозрения на патологию;<br />\r\n• Диагностика моногенных заболеваний плода на основании биопсии клеток хориона в случае подозрения на патологию;<br />\r\n• Диагностика моногенных заболеваний у членов семьи в случае подозрения на патологию у плода;<br />\r\n• Анализ генов главного комплекса гистосовместимости;<br />\r\n• Анализ наиболее распространённых полиморфизмов как у мужчины, так и у женщины, связанных с нарушениями протекания беременности у женщины;<br />\r\n• Установление отцовства.<br />\r\n<br />\r\nПри подозрении на тяжелое наследственное заболевание в педиатрии, а также у взрослых пациентов, включая диагностику у членов семьи:<br />\r\n• Диагностика моногенных заболеваний, поиск распространенных мутаций;<br />\r\n• Диагностика моногенных заболеваний, секвенирование NGS;<br />\r\n• Диагностика хромосомных перестроек, секвенирование NGS;<br />\r\n• Диагностика хромосомных перестроек, микроматричное кариотипирование;<br />\r\n• Диагностика хромосомных перестроек, FISH;<br />\r\n• Диагностика хромосомных перестроек, цитогенетическое кариотипирование.<br />\r\n<br />\r\nПри ЭКО:<br />\r\n• Диагностика моногенных заболеваний у пары или будущей мамы, поиск распространенных мутаций;<br />\r\n• Диагностика моногенных заболеваний у пары или будущей мамы, секвенирование NGS;<br />\r\n• Диагностика хромосомных перестроек у пары или будущей мамы, секвенирование NGS;<br />\r\n• Диагностика хромосомных перестроек у пары или будущей мамы, микроматричное кариотипирование;<br />\r\n• Диагностика хромосомных перестроек у пары или будущей мамы, FISH;<br />\r\n• Диагностика хромосомных перестроек у пары или будущей мамы, цитогенетическое кариотипирование;<br />\r\n• Диагностика моногенных заболеваний у доноров спермы и яйцеклеток, поиск распространенных мутаций;<br />\r\n• Диагностика моногенных заболеваний у доноров спермы и яйцеклеток, секвенирование NGS;<br />\r\n• Диагностика хромосомных перестроек у доноров спермы и яйцеклеток, секвенирование NGS;<br />\r\n• Диагностика хромосомных перестроек у доноров спермы и яйцеклеток, микроматричное кариотипирование;<br />\r\n• Диагностика хромосомных перестроек у доноров спермы и яйцеклеток, FISH;<br />\r\n• Диагностика хромосомных перестроек у доноров спермы и яйцеклеток, цитогенетическое кариотипирование;<br />\r\n• Преимплантационная генетическая диагностика методом NGS;<br />\r\n• Весь комплекс генетической диагностики при ведении беременности.<br />\r\n<br />\r\nПри планировании образа жизни:<br />\r\n• Общий генетический паспорт;<br />\r\n• Спортивный генетический паспорт;<br />\r\n• Диетологический генетический паспорт;<br />\r\n• Фармакогенетика;<br />\r\n• Анализ отдельных генов и полиморфизмов, связанных с развитием различных заболеваний.</p>\r\n      </article>',1,'2019-04-13 12:12:30','2019-04-13 13:01:48','О нас',1,NULL,1),(3,'akcii','Акции','Акции','Акции','Акции','<article>\r\n        <h1>Акции</h1>\r\n 