ования необходимо 18 мл крови (2 пробирки) беременной женщины, срок выполнения – 12 рабочих дней<br /><br />Стоимость 35 000р. - Скидка 20% = 28 000р.<br /><br />Справки по телефону: +7 (812) 947-65-38</span>\r\n      </span>\r\n    </span></a>\r\n      </article>',1,'2019-04-13 12:13:02','2019-04-13 20:39:03','Акции',2,NULL,1),(4,'uslugi-i-ceny','Услуги и цены','Услуги и цены','Услуги и цены','Услуги и цены','<article>\r\n        <h1>Услуги и цены</h1>\r\n        <div style=\"text-align: center;\">\r\n<p style=\"font-family: Roboto-Regular, Arial, &quot;Helvetica CY&quot;, &quot;Nimbus Sans L&quot;; text-align: justify;\"><b>Уважаемые посетители!</b></p>\r\n<p style=\"text-align: justify;\"><font face=\"Roboto-Regular, Arial, Helvetica CY, Nimbus Sans L\">В данном разделе в скором времени Вы сможете найти подробное описание всех направлений нашей деятельности. Разделы будут структурированы и содержать много полезной информации как для врачей, так и для пациентов.</font></p>\r\n<p style=\"text-align: justify;\"><font face=\"Roboto-Regular, Arial, Helvetica CY, Nimbus Sans L\">Сейчас Вы можете ознакомиться с перечнем наших исследований, используя навигацию в шапке сайта, на главной странице и в левом боковом меню.</font></p>\r\n<p style=\"text-align: justify;\"><font face=\"Roboto-Regular, Arial, Helvetica CY, Nimbus Sans L\">На нашем сайте есть удобный поиск. Для нахождения интересующих анализов Вам достаточно ввести полностью или частично наименование анализа или его артикул.</font></p>\r\n</div>\r\n      </article>',1,'2019-04-13 12:43:30','2019-04-13 18:50:27','Услуги и цены',3,NULL,1),(5,'zapisatsya','Записаться','Записаться','Записаться','Записаться','<article>\r\n        <h1>Записаться на прием</h1>\r\n        <form class=\"cms_feedback_form \" action=\"/zapisatsya/\" id=\"\" method=\"post\" enctype=\"multipart/form-data\"><input type=\"hidden\" name=\"cms_form\" value=\"Y\"/><div style=\"display:none\"><input name=\"myname\" value=\"\"/></div>\r\n\r\n<div cla