/td><td>10-16</td></tr>\r\n   <tr ><td>вс.</td><td>выходной</td></tr>\r\n  </table></div>\r\n<h2 id=\"point3\">МГЦ «БИОГАРМОНИЯ»</h2>\r\n<div class=\"contactsMap\"><script  type=\"text/javascript\" charset=\"utf-8\" async  src=\"https://api-maps.yandex.ru/services/constructor/1.0/js/?sid=8BHI1Gd7-Qi4GmTk5KgPyTtsmo-bwi96&amp;width=100%&amp;height=400&amp;lang=ru_RU&amp;sourceType=constructor&amp;scroll=true\"></script>\r\n</div>\r\n <div class=\"contactsText\">\r\n    <div class=\"phone\">+7 812 643 66 77</div>\r\n   <div class=\"address\">Кондратьевский пр., 23</div>\r\n   <div class=\"underground\">м. Выборгская, Площадь Ленина</div>\r\n <table class=\"worktime\">\r\n <tr><th colspan=\"2\">Часы работы:</th></tr>\r\n   <tr ><td>пн.</td><td>9-18</td></tr>\r\n   <tr><td>вт.</td><td>9-18</td></tr>\r\n   <tr ><td>ср.</td><td>9-18</td></tr>\r\n   <tr><td>чт.</td><td>9-18</td></tr>\r\n   <tr ><td>пт.</td><td>9-18</td></tr>\r\n   <tr><td>сб.</td><td>11-14</td></tr>\r\n   <tr ><td>вс.</td><td>выходной</td></tr>\r\n  </tbody></table></div>\r\n​\r\n      </article>',1,'2019-04-13 12:44:44','2019-04-13 20:35:45','Контакты',6,NULL,1),(8,'policy','Политика конфиденциальности и обработки персональных данных','Политика конфиденциальности и обработки персональных данных','Политика конфиденциальности и обработки персональных данных','Политика конфиденциальности и обработки персональных данных','Политика конфиденциальности и обработки персональных данных',1,'2019-05-01 18:42:53','2019-05-01 18:43:06','Политика конфиденциальности и обработки персональных данных',NULL,NULL,0),(9,'oferta','Публичная оферта','Публичная оферта','Публичная оферта','Публичная оферта','<p><strong>ПУБЛИЧНАЯ ОФЕРТА</strong></p>\r\n\r\n<p><strong>1. Политика в отношении персональных данных</strong></p>\r\n\r\n<p>Настоящий документ является публичной офертой и определяет условия обработки Оператором сайта http://www.cerbalab.ru/ (далее - Сайт) &ndash; Обществом с ограниченной ответственностью &laquo;СЕРБАЛАБ&raquo; (сокращённое наименование &ndash; ООО &laquo;СЕРБАЛАБ&raquo;, ОГРН 1157847439045, адрес: 199106, г. Санкт-Петербург, Большой пр. В.О., д.90, корп.2, литер &laquo;з&raquo;, далее &ndash; Оператор), персональных данных Пользователя Сайта (далее &ndash; &laquo;Пользователь&raquo;). Пользователь, принимая решение о предоставлении своих персональных данных путем заполнения полей формы &laquo;Обратная связь&raquo;:</p>\r\n\r\n<p>1. подтверждает, что все указанные им данные принадлежат лично ему;</p>\r\n\r\n<p>2. подтверждает, что им внимательно и в полном объеме прочитаны и поняты настоящие условия обработки персональных данных;</p>\r\n\r\n<p>3. дает Оператору согласие на обработку следующих персональных данных: фамилия, имя, отчество, телефон, e-mail;</p>\r\n\r\n<p>4. выражает согласие с настоящими условиями обработки персональных данных без каких-либо оговорок и ограничений.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Обработка персональных данных осуществляется Оператором с целью возможности предоставления Пользователю услуг Сайта, в том числе, но не ограничиваясь перечисленными: услуга заказа обратного звонка, услуга онлайн-записи на приём. Обработка персональных данных осуществляется Оператором в порядке и на условиях, предусмотренных Политикой обработки персональных данных в Обществе с ограниченной ответственностью &laquo;СЕРБАЛАБ&raquo;, утвержденной Приказом Генерального директора ООО &laquo;СЕРБАЛАБ&raquo; от 10.02.2014 г. No28.</p>\r\n\r\n<p>Пользователь предоставляет Оператору право осуществлять следующие действия с персональными данными: сбор, запись, систематизацию, накопление, хранение (в том числе с использованием автоматической системы хранения и обработки данных), уточнение (обновление, изменение), извлечение, использование, передачу (распространение, предоставление, доступ), обезличивание, блокирование, удаление, уничтожение персональных данных. Оператор вправе осуществлять поименованные действия с использованием средств автоматизации или без использования таких средств.</p>\r\n\r\n<p>Оператор вправе поручить обработку персональных данных Пользователя третьим лицам (при условии соблюдения режима конфиденциальности персональных данных, а также при условии, что таковое не нарушает законные права и интересы Пользователя и положения действующего законодательства Российской Федерации), в том числе, но не ограничиваясь перечисленными: Возможно указание другого ООО, если нам это надо.</p>\r\n\r\n<p>Согласие на обработку персональных данных действует с момента предоставления Пользователем Оператору своих персональных данных до достижения целей обработки персональных данных, установленных настоящими условиями обработки персональных данных. Согласие может быть отозвано путем направления Пользователем в адрес Оператора письменного запроса на отзыв согласия на обработку персональных данных.</p>\r\n\r\n<p>Изложенный ниже текст Оферты является адресованным физическим лицам официальным публичным предложением заключить договор об оказании услуг в соответствии с п.2 ст.437 ГК РФ. Договор считается заключенным и приобретает силу с момента совершения Вами действий, предусмотренных в Оферте и означающих Ваше безоговорочное присоединение ко всем условиям Оферты без каких-либо изъятий или ограничений.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ПУБЛИЧНАЯ ОФЕРТА</strong></p>\r\n\r\n<p><strong>2. Оказание услуг генетической диагностики</strong></p>\r\n\r\n<p>ООО &laquo;СЕРБАЛАБ&raquo;, именуемое в дальнейшем &laquo;Исполнитель&raquo;, заключает настоящий Договор с лицом, именуемым в дальнейшем &laquo;Заказчик&raquo;, на предмет предоставления услуги генетической диагностики. Договор заключается путем публичной оферты и регламентирует порядок предоставления услуг и обязательства, возникающие в связи с этим между Исполнителем и Заказчиком.</p>\r\n\r\n<p>1. Предмет Договора.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1.1. По настоящему Договору Исполнитель принимает на себя обязательство оказывать Заказчику платные услуги в области лабораторной и медицинской генетики, (далее &laquo;услуги&raquo;) в соответствии с условиями настоящего Договора и приложениями к нему, Заказчик обязуется принимать и оплачивать услуги Исполнителя.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. Порядок исполнения Договора.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2.1. Оказание услуг осуществляется на основании запроса Заказчика. Порядок и последовательность действий Сторон в целях исполнения п.1.1. настоящего Договора в отношении каждой конкретной услуги, оказываемой Исполнителем, определяется Правилами оказания услуг, устанавливаемыми Исполнителем.</p>\r\n\r\n<p>2.2. Транспортировка биоматериала обеспечивается Исполнителем своими силами и за свой счет, либо с привлечением третьих лиц, при этом Исполнитель несет полную ответственность перед Заказчиком, за привлеченных им третьих лиц. Исполнитель несет ответственность за качественную и правильную транспортировку биоматериала.</p>\r\n\r\n<p>2.3. По результатам оказания услуг Исполнитель представляет Заказчику Заключение, содержащее результат оказанной услуги и пояснения Исполнителя по предмету оказанной услуги. Передача Заключения осуществляется посредством электронной связи в порядке, установленном в п. 8.1 настоящего Договора, оригиналы Заключений Исполнитель направляет или на адрес Заказчика, соблюдая условия конфиденциальности такой отправки, или, по договоренности Сторон, оригиналы заключений могут забираться представителем Заказчика.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3. Права и обязанности Сторон.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3.1. Исполнитель обязуется:</p>\r\n\r\n<p>3.1.1. Оказывать Заказчику услуги в соответствии с условиями настоящего Договора;</p>\r\n\r\n<p>3.1.2. Проводить исследования качественно, с использованием современных методов диагностики, в полном объеме в соответствии с настоящим Договором;</p>\r\n\r\n<p>3.1.3. Обеспечить участие высококвалифицированного персонала в проведении медицинских исследований/предоставлении медицинских услуг по настоящему Договору;</p>\r\n\r\n<p>3.1.4. Вести учет оказываемых услуг, а также всю необходимую медицинскую документацию в установленном действующим законодательством порядке;</p>\r\n\r\n<p>3.1.5. Немедленно извещать Заказчика о невозможности оказания услуг по настоящему Договору;</p>\r\n\r\n<p>3.1.6. Сохранять конфиденциальность сведений, предоставленных в рамках настоящего Договора, в том числе сведений о результатах исследования и характеристиках биоматериала, информации, касающейся результатов оказания услуг и исполнения настоящего Договора, и раскрывать данные сведения только на основании согласия Заказчика и только в пределах, предусмотренных данным согласием.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3.2. Исполнитель имеет право:</p>\r\n\r\n<p>3.2.1. Привлекать третьих лиц к исполнению своих обязанностей по настоящему Договору, при этом Исполнитель несет полную ответственность перед Заказчиком за привлеченных им третьих лиц;</p>\r\n\r\n<p>3.2.2. На хранение и обработку персональных данных Заказчика, полученных в ходе исполнения настоящего Договора, в соответствии с целями Договора и в пределах, установленных Договором и приложениями к нему;</p>\r\n\r\n<p>3.2.3. Приостанавливать оказание услуг по настоящему Договору при возникновении задолженности по оплате услуг Исполнителя до момента погашения Заказчиком указанной задолженности.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3.3. Заказчик обязуется:</p>\r\n\r\n<p>3.3.1. Оплачивать стоимость услуг в порядке и сроки, установленные в настоящем Договоре;</p>\r\n\r\n<p>3.3.2. Предоставлять Исполнителю всю документацию и информацию, необходимую для исполнения настоящего Договора;</p>\r\n\r\n<p>3.3.3. Вести учет оказываемых по настоящему Договору услуг;</p>\r\n\r\n<p>3.3.4. Принимать оказанные услуги в соответствии с настоящим Договором;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3.4. Заказчик имеет право:</p>\r\n\r\n<p>3.4.1. Получать информацию о ходе выполнения Исполнителем проводимых работ (услуг), а также иную информацию согласно настоящему Договору;</p>\r\n\r\n<p>3.4.2. Отказаться от исполнения настоящего Договора путем подачи письменного уведомления, оплатив Исполнителю сумму фактически понесенных расходов, которая определяется исходя из стоимости запрошенных Заказчиком услуг и объемов проделанной работы.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4. Стоимость работ (услуг), порядок расчетов по Договору.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4.1. Стоимость оказания услуг по настоящему Договору определяется в соответствии с действующим Прайс-листом Исполнителя. Услуги НДС не облагаются ввиду применения Исполнителем УСН.</p>\r\n\r\n<p>4.2. Исполнитель оставляет за собой право пересматривать список услуг в Прайс-листе и их стоимость в одностороннем порядке, о чем уведомляет Заказчика за 10 (Десять) рабочих дней до вступления изменений в силу. Стоимость уже оказанных услуг или услуг, находящихся в стадии оказания, пересмотрена быть не может.</p>\r\n\r\n<p>4.3. Оплату услуг Исполнителя Заказчик производит путем перечисления денежных средств на расчетный счет Исполнителя.</p>\r\n\r\n<p>4.4. В случае, если по каким-либо причинам оказание услуг в рамках настоящего Договора на каком-либо этапе окажется невозможным по причине отказа Заказчика и/или иным причинам, не зависящим от Исполнителя, Заказчик обязуется оплатить услуги, фактически оказанные Исполнителем. Стоимость фактически оказанных услуг определяется исходя из стоимости услуг и объемов проделанной работы и подлежит уплате Заказчиком в порядке, установленном в п. 4.3. настоящего Договора.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5. Ответственность Сторон</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5.1. В случае неисполнения или ненадлежащего исполнения своих обязательств по настоящему Договору Стороны несут ответственность в соответствии с действующим законодательством Российской Федерации.</p>\r\n\r\n<p>5.2. В случае некачественного оказания Исполнителем услуг при предоставлении Заказчиком мотивированной претензии их повторное оказание осуществляется за счет Исполнителя (за исключением случаев, связанных с технологическими особенностями используемого метода и/или предоставления некачественного материала для исследования).</p>\r\n\r\n<p>5.3. Стороны будут прилагать все усилия к тому, чтобы урегулировать возникающие разногласия и споры, связанные с исполнением настоящего Договора, путем переговоров.</p>\r\n\r\n<p>5.4. В случае, если разногласия и споры не могут быть разрешены Сторонами путем двусторонних переговоров, они решаются в Арбитражном суде в порядке, предусмотренном законодательством РФ, с соблюдением претензионного порядка.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>6. Срок и прекращение действия Договора.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>6.1. Срок действия настоящего Договора составляет 1 (один) год с даты подписания.</p>\r\n\r\n<p>6.2. Настоящий Договор автоматически считается расторгнут, если ни одна из Сторон не заявит о своем намерении пролонгировать Договор за один месяц до истечения срока его действия.</p>\r\n\r\n<p>6.3. Настоящий Договор может быть изменен либо досрочно прекращен во внесудебном порядке по соглашению Сторон, оформленному письменно и подписанному Сторонами.</p>\r\n\r\n<p>6.4. Настоящий Договор может быть досрочно прекращен в одностороннем внесудебном порядке:</p>\r\n\r\n<p>- при письменном уведомлении другой Стороны об этом намерении не позднее одного месяца до предполагаемой даты расторжения;</p>\r\n\r\n<p>- в случае неоднократного невыполнения одной из Сторон обязательств по настоящему Договору;</p>\r\n\r\n<p>- в случае прекращения деятельности, ликвидации или реорганизации одной из Сторон, при этом за другой Стороной сохраняется право требовать возмещения убытков.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>7. Дополнительные условия.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>7.1 Условия настоящего Договора и соглашений к нему конфиденциальны и разглашению не подлежат.</p>\r\n\r\n<p>В целях исполнения настоящего Договора Исполнитель обеспечивает конфиденциальность персональных данных, надлежащим образом хранит персональные данные не дольше, чем того требует исполнение условий настоящего Договора, обрабатывают персональные данные в соответствии с действующим законодательством РФ и Федеральным законом от 27.07.2006 года № 152-ФЗ &laquo;О персональных данных&raquo;.</p>\r\n\r\n<p>7.2 Отправка и получение всех направлений, уведомлений, запросов и прочий документооборот между Сторонами осуществляется посредством электронной связи по адресам контактных лиц, если в тексте отдельных положений Договора не указано иное.</p>\r\n\r\n<p>7.3 Стороны обязуются сохранять конфиденциальность всей информации, касающейся настоящего Договора. Стороны не должны открывать такую информацию третьим лицам, за исключением случаев, когда:</p>\r\n\r\n<p>- Это прямо предусмотрено настоящим Договором для надлежащего выполнения обязательств по настоящему Договору;</p>\r\n\r\n<p>- Такая информация является общедоступной;</p>\r\n\r\n<p>- По письменному согласованию Сторон.</p>\r\n\r\n<p>7.4 При выполнении настоящего Договора, Стороны руководствуются действующим законодательством Российской Федерации.</p>\r\n\r\n<p>7.5 Любые изменения и дополнения к настоящему Договору действительны, если они составлены в письменной форме и подписаны уполномоченными представителями Сторон.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>8 Форс-мажор.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>8.1 Если иное не установлено настоящим Договором, Стороны освобождаются от ответственности за частичное или полное неисполнение обязательств по нему в случае, если оно явилось следствием обстоятельств непреодолимой силы (стихийных бедствий, наводнения или землетрясения), военных действий, блокады, принятия актов государственных органов или других не зависящих от Сторон обстоятельств (за исключением обстоятельств, относимых к коммерческим</p>\r\n\r\n<p>рискам осуществления предпринимательской деятельности) и если эти обстоятельства непосредственно повлияли на исполнение настоящего Договора. При этом сроки исполнения обязательств по Договору отодвигаются соразмерно времени, в течение которого действовали такие обстоятельства и их последствия.</p>\r\n\r\n<p>8.2 Сторона, для которой создалась невозможность исполнения обязательств по настоящему Договору, должна немедленно (в течение 3 рабочих дней с момента наступления данных обстоятельств) известить другую Сторону о наступлении и прекращении обстоятельств, препятствующих исполнению обязательств.</p>\r\n\r\n<p>8.3 Несвоевременное (свыше 3 (трех) рабочих дней) уведомление о наступлении или прекращении форс-мажорных обстоятельств лишает Сторону права ссылаться на них.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>9. Заключительные положения.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>9.1. Договор и все документы к нему подлежат подписанию уполномоченными представителями обеих Сторон.</p>\r\n\r\n<p>9.2. Настоящий Договор и другие документы составляют и представляют собой полное соглашение Сторон по предмету настоящего Договора при условии их единства и совокупности.</p>\r\n\r\n<p>9.3. Составлением всей совокупности указанных документов Стороны свидетельствуют о полном своем взаимопонимании по предмету и условиям настоящего Договора и подтверждают, что не основываются ни на каком ином представлении или гарантии, кроме тех, которые в явной форме в них приводятся.</p>\r\n\r\n<p>9.4. Если какое-либо из положений настоящего Договора является или становится незаконным, недействительным или не могущим быть приведенным в исполнение по российскому законодательству, другие положения настоящего Договора не утрачивают в связи с названным обстоятельством законности, действительности или возможности принудительного исполнения по данному законодательству.</p>\r\n\r\n<p>9.5. Подзаголовки в настоящем Договоре используются для удобства и не влияют на смысл содержания.</p>\r\n\r\n<p>9.6. Настоящий Договор составлен в двух имеющих равную юридическую силу экземплярах по одному экземпляру для каждой из Сторон.</p>',1,'2019-05-01 18:43:57','2019-05-10 07:19:46','Публичная оферта',NULL,NULL,0);
